import "./NewPost.css";
import Input from "../../global/components/form-comps/Input";

const NewPost = (props) => {
  return (
    <form className="post-form">
      <Input
        element="input"
        type="text"
        label="Title"
        validators={[]}
        errorText="Enter a valid title."
      />
    </form>
  );
};

export default NewPost;
